// 删除组件
function onComponentDelete(id, type) {
    console.log("删除" + type + "#" + id);
    if (type == 'flow') {
        // 删除工作流下的所有节点
        let nodesList = workflow.task[id].nodes;
        for (let i = 0, len = nodesList.length; i < len; i++) {
            let nodeId = nodesList[i];
            workflow.used[workflow.task[nodeId].type] -= 1;
            delete workflow.task[nodeId];
        }
        // 清除上一flow的节点
        hideNodesByFlow(id);
        workflow.currentFlowId = null;
    } else {
        // 删除与之相连的路径
        d3.selectAll('path[from="' + id + '"]').remove();
        d3.selectAll('g[id="' + id + '"]').remove();
        d3.selectAll('path[to="' + id + '"]').remove();

        // 删除与该节点相关的记录
        let flowId = workflow.task[id].z;
        let index = workflow.task[flowId].nodes.indexOf(id.toString());
        if (index > -1) {
            workflow.task[flowId].nodes.splice(index, 1);
        }
        for (let i = 0, len = workflow.task[flowId].nodes.length; i < len; i++) {
            let nodeId = workflow.task[flowId].nodes[i];
            let index = workflow.task[nodeId].links.indexOf(id.toString());
            if (index > -1) {
                workflow.task[nodeId].links.splice(index, 1);
            }
        }
    }
    // 删除该组件
    delete workflow.task[id];
    // 组件使用次数减一
    if (workflow.used[type]) {
        workflow.used[type] -= 1;
    }
    // 更新workflow
    console.log(workflow.currentFlowId);
    vm.updateWorkflow(workflow);
    $('#configModal').modal('hide');
    vm.configFlag = false;
}

// 获取组件参数
function getComponentParams(id, type) {
    if (!workflow.task[id]) {
        return;
    }
    let currentParams = workflow.task[id];

    let keyList = {};
    for (let key in currentParams) {
        keyList[key] = 1;
    }
    let params = {};
    let attrInfo = deepClone(component_config[type]['params']);
    // 遍历配置
    for (let i = 0, len = attrInfo.length; i < len; i++) {
        // 更新可配置的参数
        if (attrInfo[i]['configurable']) {
            let currentKey = attrInfo[i]['name'];
            attrInfo[i]['default'] = currentParams[currentKey];
            params[currentKey] = attrInfo[i];
        }
    }
    return params;
}

// 更新组件参数
function updateComponentParams(component, callback) {
    let id = component.id;
    if (!workflow.task[id]) {
        return;
    }
    // 计数器, 记录参数改变的个数
    let changeCount = 0;
    // 遍历并更新参数值
    let paramsUpdate = component.params;
    for (let paramName in paramsUpdate) {
        console.log(workflow.task[id][paramName], paramsUpdate[paramName].default);
        if (paramName == 'variable') {
            let v = vm.variableSpaceMap[workflow.currentFlowId][paramsUpdate[paramName].default];
            console.log(v);
            if (v != undefined && v != id) {
                callback.error();
                return;
            }
            vm.variableSpaceMap[workflow.currentFlowId][paramsUpdate[paramName].default] = id;
        }
        if (workflow.task[id][paramName] != paramsUpdate[paramName].default) {
            workflow.task[id][paramName] = paramsUpdate[paramName].default;
            changeCount++;
        }
    }
    if (component.type == 'data-load') {
        workflow.task[id].data_id = vm.dataSets[workflow.task[id].data_set].id;
        workflow.task[id].field_info = $("select[name='field_info']").multipleSelect('getSelects');
        workflow.task[id].tag = {};
        for (let tagName in vm.dataSet.tag) {
            workflow.task[id].tag[tagName] = [];
            let selectedList = $("select[name='" + tagName + "']").multipleSelect('getSelects');
            console.log(selectedList);
            workflow.task[id].tag[tagName] = selectedList;
        }
        paramsUpdate['tag'].default = workflow.task[id].tag;
    }
    // 如果参数改变个数不为空，则代表workflow已改变
    if (changeCount != 0) {
        console.log('参数改变');
        vm.updateWorkflow(workflow, id);
        let status = {};
        status[id] = 6;
        updateNodeStatus(status);
        onComponentDetail(id, component.type, true);
    }
    callback.success();
}

// 获取组件信息
function getComponent(id, type, lang = 'zh') {
    if (!workflow.task[id]) {
        return;
    }
    let component = {};
    component.id = id;
    component.name = component_config[type]['display'][lang];
    component.type = type;
    component.params = getComponentParams(id, type);
    if (component_config[type].description) {
        component.description = component_config[type].description;
    }
    return component;
}

/**
 * 组件相关 End
 */

// 运行节点
function runNode(id) {
    return vm.runNode(id);
}

// 暂停节点
function stopNode(id) {
    vm.stopNode(id);
}

// 点击连线
function onPathClick(id) {
    // 事件过滤
    if (id == vm.path.id) {
        console.log('重复点击连线，事件无效！');
        return;
    }
    // 更新状态
    vm.update();
    d3.selectAll('path[id="' + id + '"]').attr('class', 'cable active');
    vm.path.from = d3.select('path[id="' + id + '"]').attr('from');
    vm.path.to = d3.select('path[id="' + id + '"]').attr('to');
    vm.path.id = id;
    console.log(JSON.stringify(vm.path));
}

// 删除连线
function onPathDelete(id) {
    d3.select('path[id="' + id + '"]').remove();
    let nodeIds = id.split("_");
    let sId = nodeIds[0];
    let eId = nodeIds[1];
    let index = workflow.task[sId].links.indexOf(eId.toString());
    if (index > -1) {
        workflow.task[sId].links.splice(index, 1);
    }
    vm.updateWorkflow(workflow, workflow.currentFlowId);
}

// 加载工作流
function loadWorkflow(workflowFile) {
    $.getJSON('../debug/workflow/' + workflowFile + '.json', function (data) {
        workflow = data;
        vm.updateWorkflow(workflow);
    });
}

function saveWorkflow(){
    console.log(JSON.stringify(workflow));
}

// 可视化
function visualize(data) {
    $('.visual-chart').attr('style', 'display:none');
    var op = data.op;
    console.log(op);
    switch (op) {
        case "data-upload":
        case "data-load":
        case "prehandle":
        case "build-feature-database":
        case "feature-select":
      case "kmeans":
      case "knn":
      case "svm":
            $('#data-load').attr('style', 'display:block');
            showGraph(data.result);
            break;
        case "stl":
        case "rshash":
            $('#abnormalChart').attr('style', 'display:block');
            abnormalVisual(data.result);
            break;
        case "hime":

        case "mpmotif":
            $('#hime').attr('style', 'display:block');
            himeVisual(data.result, op);
            break;
        case "matrix-profile":
            $('#matrixProfile').attr('style', 'display:block');
            matrixProfileVisual("matrixProfile", data.result);
            break;
        case "mpsegment":
            $('#segment').attr('style', 'display:block');
            segmentationVisual(data.result);
            break;

        case "cluster":
        case "seql":
        case "fsh":
        case "elis":
        case "lts":
        case "kshape":
            const cluster = $('#cluster');
            cluster.resize(function () {
                refreshCluster()
            });
            cluster.attr('style', 'display:block');
            initCluster(data.result);
            break;
        default:
            console.log('default');
            break;
    }
}

